import { Routes } from '@angular/router';

export const appRoutes: Routes = [
    {
        path: 'login',
        loadChildren: () => import('./pages/page-login/page-login.component').then(c => c.PageLoginComponent)
    },
    {
        path: 'inscrire',
        loadChildren: () => import('./pages/page-inscription/page-inscription.component').then(c => c.PageInscriptionComponent)
    }
];
